import { DataInput } from "./FormStyles";

interface Props {
  labelName: string;
  min: number;
  inputValue: string;
  inputChange: (event: React.ChangeEvent<HTMLInputElement>)=>void;
};

const FormInput: React.FC<Props> = (props) => {

  return(
    <DataInput placeholder={props.labelName} minLength={props.min} value={props.inputValue} onChange={props.inputChange}/>
  )
};

export default FormInput
